import React from 'react';
import Navbar from './components/header/Navbar';
import './App.css';
import Home from './components/pages/Home';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Services from './components/pages/Services';
import Products from './components/pages/Products';
import ContactUs from './components/pages/ContactUs';
import SignUp from './components/pages/SignUp';
import PVP from './components/pages/PVP';
import Consulting from './components/pages/Consulting';
import Yugitoken from './components/pages/Yugitoken';

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path='/' exact component={Home} />
        <Route path='/services' component={Services} />
        <Route path='/roadmap' component={Products} />
        <Route path='/about' component={Yugitoken} />
        <Route path='/contact-us' component={ContactUs} />
        <Route path='/sign-up' component={SignUp} />
        <Route path='/PVP' component={PVP} />
        <Route path='/PVE' component={Consulting} />
      </Switch>
    </Router>
  );
}

export default App;
